import { Form, Button, Row, Col } from "react-bootstrap";
import API from "../components/utils/API"

const NewEncounter = () => {
    return (
        <div>
            <Row className='NewEncounterHeader'>
                <Col className='col-10 offset-1'>
                    <h3>Create new Encounter</h3>
                </Col>
            </Row>
            
        </div>
    )
}

export default NewEncounter
